[16048] = {name = "Schematic: Dark Iron Rifle", additional_info = "Requires Engineering (275)\nUse: Teaches you how to make a Dark Iron Rifle.\nDark Iron Rifle\nBinds when equipped\nRanged Gun\n53 - 100 Damage Speed 2.70\n(28.33 damage per second)\nDurability 75 / 75\nRequires Level 50\nEquip: Chance to strike your ranged target with Shadow Shot for 18 to 26 Shadow damage.\nRequires Thorium Tube (2), Dark Iron Bar (6), Deadly Scope (2), Blue Sapphire (2), Large Opal (2), Rugged Leather (4)"},
[16049] = {name = "Schematic: Dark Iron Bomb", additional_info = "Requires Engineering (285)\nUse: Teaches you how to make a Dark Iron Bomb.\nDark Iron Bomb\nRequires Engineering (285)\nUse: Inflicts 225 to 675 Fire damage and stuns targets in a 5 yard radius for 4 sec.  Any damage will break the effect. (1 Min Cooldown)\nRequires Thorium Widget (2), Dark Iron Bar , Dense Blasting Powder (3), Runecloth (3)"},
[16050] = {name = "Schematic: Delicate Arcanite Converter", additional_info = "Requires Engineering (285)\nUse: Teaches you how to make a Delicate Arcanite Converter.\nDelicate Arcanite Converter\nRequires Arcanite Bar , Ironweb Spider Silk"},
[16051] = {name = "Schematic: Thorium Shells", additional_info = "Requires Engineering (285)\nUse: Teaches you how to make Thorium Shells.\nThorium Shells\nAmmo Bullet\nAdds 17.5 damage per second\nRequires Level 52\nRequires Thorium Bar (2), Dense Blasting Powder"},
[16052] = {name = "Schematic: Voice Amplification Modulator", additional_info = "Requires Engineering (290)\nUse: Teaches you how to make a Voice Amplification Modulator.\nVoice Amplification Modulator\nBinds when equipped\nNeck\nEquip: Increases your resistance to silence effects by 7%.\nRequires Delicate Arcanite Converter (2), Gold Power Core , Thorium Widget , Large Opal"},
[16053] = {name = "Schematic: Master Engineer's Goggles", additional_info = "Requires Engineering (290)\nUse: Teaches you how to make Master Engineer's Goggles.\nMaster Engineer's Goggles\nBinds when equipped\nHead Cloth\n61 Armor\n+16 Stamina\n+17 Spirit\nDurability 45 / 45\nRequires Engineering (280)\nRequires Fire Goggles , Huge Emerald (2), Enchanted Leather (4)"},
[16054] = {name = "Schematic: Arcanite Dragonling", additional_info = "Requires Engineering (300)\nUse: Teaches you how to make an Arcanite Dragonling.\nArcanite Dragonling\nBinds when equipped\nUnique\nTrinket\nRequires Level 50\nRequires Engineering (300)\nUse: Activates your Arcanite Dragonling to fight for you for 1 min.  It requires an hour to cool down before it can be used again. (1 Hour Cooldown)\nRequires Mithril Mechanical Dragonling , Delicate Arcanite Converter (8), Enchanted Thorium Bar (10), Thorium Widget (6), Gold Power Core (4), Enchanted Leather (6)"},
[16055] = {name = "Schematic: Arcane Bomb", additional_info = "Requires Engineering (300)\nUse: Teaches you how to make an Arcane Bomb.\nArcane Bomb\nRequires Engineering (300)\nUse: Drains 675 to 1125 mana from those in the blast radius and does 50% of the mana drained in damage to the target.  Also Silences targets in the blast for 5 sec. (1 Min Cooldown)\nRequires Delicate Arcanite Converter , Thorium Bar (3), Runecloth"},
[16056] = {name = "Schematic: Flawless Arcanite Rifle", additional_info = "Requires Engineering (300)\nUse: Teaches you how to make a Flawless Arcanite Rifle.\nFlawless Arcanite Rifle\nBinds when equipped\nRanged Gun\n65 - 122 Damage Speed 3.00\n(31.17 damage per second)\nDurability 75 / 75\nRequires Level 56\nEquip: Increased Guns +4.\nEquip: +10 ranged Attack Power.\nRequires Arcanite Bar (10), Thorium Tube (2), Essence of Fire (2), Essence of Earth (2), Azerothian Diamond (2), Enchanted Leather (2)"},
