[22496] = {name = "Frostfire Robe", additional_info = "Binds when picked up\nChest Cloth\n138 Armor\n+21 Stamina\n+27 Intellect\nDurability 100 / 100\nRequires Level 60\nEquip: Increases damage and healing done by magical spells and effects by up to 47.\nEquip: Improves your chance to hit with spells by 1%.\nEquip: Improves your chance to get a critical strike with spells by 1%.\nEquip: Decreases the magical resistances of your spell targets by 13.\n\nFrostfire Regalia (0/9)\nFrostfire Belt\nFrostfire Bindings\nFrostfire Circlet\nFrostfire Gloves\nFrostfire Leggings\nFrostfire Robe\nFrostfire Sandals\nFrostfire Shoulderpads\nFrostfire Ring\n(2) Set : Reduces cooldown on your Evocation by 1 minute.\n(4) Set : Gives your Mage Armor a chance when struck by a harmful spell to increase resistance against that school of magic by 35 for 30 sec. (Proc chance: 20%)\n(6) Set : Your damage spells have a chance to cause your target to take up to 200 increased damage from subsequent spells. (Proc chance: 20%)\n(8) Set : Your damage spells have a chance to displace you, causing the next spell cast to generate no threat. (Proc chance: 15%)"},
