[203726] = {name = "Cutty's Rune", additional_info = "Classes: Rogue"},
[203745] = {name = "Spell Notes: Ice Lance", additional_info = "Binds when picked up\nUnique\nRequires\nEngraving\n(1)\nEngrave your gloves with the Ice Lance rune:\n\n\nDeals (* 55 / 100) to (* 65 / 100) Frost damage to an enemy target.  Causes triple damage against Frozen targets.\n\"Teaches you a new Runecarving ability.\""},
[203746] = {name = "Spell Notes: Living Flame", additional_info = "Binds when picked up\nUnique\nRequires\nEngraving\n(1)\nEngrave your pants with the Living Flame rune:\n\n\nSummons a spellfire flame that moves toward the target, leaving a trail of spellfire. This trail deals (* 100 / 100) Spellfire damage every second to nearby enemies. Lasts 20 sec.\n\"Teaches you a new Runecarving ability.\""},
[203747] = {name = "Spell Notes: Fingers of Frost", additional_info = "Binds when picked up\nUnique\nRequires\nEngraving\n(1)\nEngrave your chest or robe with the Fingers of Frost rune:\n\n\nGives your Chill effects a 15% chance to grant you the Fingers of Frost effect, which treats your next 2 spells cast as if the target were Frozen.  Lasts 15 sec.\n\"Teaches you a new Runecarving ability.\""},
[203748] = {name = "Spell Notes: Burnout", additional_info = "Binds when picked up\nUnique\nClasses: Mage\nEngrave your chest with the Burnout rune:\n\n\nIncreases your spell critical strike chance with all spells by 15%, but your non-periodic spell critical strikes now have an additional mana cost of 1% of your base mana.\n\"Teaches you a new Engraving ability.\""},
[203749] = {name = "Spell Notes: Enlightenment", additional_info = "Binds when picked up\nUnique\nClasses: Mage\nEngrave your chest or robe with the Enlightenment rune:\n\n\nYou deal 10% more damage while you have more than 70% mana. While below 30% mana 10% of your mana regeneration continues while casting.\n\"Teaches you a new Engraving ability.\""},
[203750] = {name = "Elwynn Treasure Map", additional_info = "Binds when picked up\nClasses: Rogue\nUse: Dig up treasure at the marked location (1 Min Cooldown)\n\"West of ridgepoint tower. Near the stump behind the prowler den.\""},
[203751] = {name = "Spell Notes: CALE ENCI", additional_info = "Binds when picked up\nUnique\nClasses: Mage\nUse: Decipher the spell notes with a Comphrehension Primer to learn a new Engraving spell."},
[203752] = {name = "Spell Notes: MILEGIN VALF", additional_info = "Binds when picked up\nUnique\nClasses: Mage\nUse: Decipher the spell notes with a Comprehension Charm to learn a new Engraving spell."},
[203753] = {name = "Spell Notes: RING SEFF OSTROF", additional_info = "Binds when picked up\nUnique\nClasses: Mage\nUse: Decipher the spell notes with a Comprehension Charm to learn a new Engraving spell."},
[203754] = {name = "Archmage Antonidas: The Unabridged Autobiography", additional_info = "Binds when picked up\nUnique\n\"Somewhat self-indulgent, but nevertheless a fine addition to any library's collection.\""},
[203755] = {name = "Archmage Theocritus's Research Journal", additional_info = "Unique\n\"Research notes from the Tower of Azora. A fine addition to any library's collection.\""},
[203756] = {name = "Azora Apprentice Notes: Page 1", additional_info = "Binds when picked up\nUnique\nUse: Combine 6 Azora Apprentice Notes to create a new engraving recipe."},
[203784] = {name = "Top-Right Map Piece", additional_info = "Use: Combine with 3 other pieces to make the full map.\n\"A torn piece of what seems to be a map...\""},
[203785] = {name = "Top-Left Map Piece", additional_info = "Use: Combine with 3 other pieces to make the full map.\n\"A torn piece of what seems to be a map...\""},
[203786] = {name = "Bottom-Right Map Piece", additional_info = "Use: Combine with 3 other pieces to make the full map.\n\"A torn piece of what seems to be a map...\""},
[203787] = {name = "Bottom-Left Map Piece", additional_info = "Use: Combine with 3 other pieces to make the full map.\n\"A torn piece of what seems to be a map...\""},
[203960] = {name = "Azora Apprentice Notes: Page 2", additional_info = "Binds when picked up\nUnique\nUse: Combine 6 Azora Apprentice Notes to create a new engraving recipe."},
[203961] = {name = "Azora Apprentice Notes: Page 3", additional_info = "Binds when picked up\nUnique\nUse: Combine 6 Azora Apprentice Notes to create a new engraving recipe."},
[203962] = {name = "Azora Apprentice Notes: Page 4", additional_info = "Binds when picked up\nUnique\nUse: Combine 6 Azora Apprentice Notes to create a new engraving recipe."},
[203990] = {name = "Rune of Mutilation", additional_info = "Binds when picked up\nUnique\nClasses: Rogue\nEngrave your gloves with the Mutilate rune:\n\n\nInstantly attacks with both weapons for 100% weapon damage plus an additional (100 / 100 *) with each weapon.  Damage is increased by 20% against Poisoned targets.  Awards 2 combo points.\n\n Mutilate benefits from all talents and effects that trigger from or modify Backstab unless otherwise specified.\n\"Teaches you a new Engraving ability.\""},
[203991] = {name = "Rune of Quick Draw", additional_info = "Binds when picked up\nUnique\nClasses: Rogue\nEngrave your chest or robe with the Quick Draw rune:\n\n\nDraw your ranged weapon and fire a quick shot at an enemy, causing normal ranged weapon damage and reducing the target's movement speed by 50% for 6 sec. Awards 1 combo point.\n\n Quick Draw benefits from all talents and effects that trigger from or modify Sinister Strike.\n\"Teaches you a new Engraving ability.\""},
[203992] = {name = "Rune of Trickery", additional_info = "Classes: Rogue\n\"Teaches you a new Engraving ability.\""},
[203993] = {name = "Rune of Slaughter", additional_info = "Binds when picked up\nUnique\nClasses: Rogue\nEngrave your chest or robe with the Slaughter from the Shadows rune:\n\n\nReduces the Energy cost of your Backstab and Ambush abilities by 20.\n\nEngrave Gloves - Mutilate\nDoes not apply to Mutilate\n\n Does not apply to abilities learned from other runes.\n\"Teaches you a new Engraving ability.\""},
[203994] = {name = "Rune of Deadly Brew", additional_info = "Binds when picked up\nUnique\nClasses: Rogue\nEngrave your chest or robe with the Deadly Brew rune:\n\n\nGrants several improvements to your poisons:\n\n When you inflict any other poison on a target, you also inflict Deadly Poison.\n\n If your weapon does not have a poison applied, it has a chance to trigger Instant Poison as if Instant Poison were applied.\n\n Deadly Poison and Instant Poison now gain increased damage from your Attack Power.\n\"Teaches you a new Engraving ability.\""},
[204174] = {name = "Rune of Precision", additional_info = "Binds when picked up\nUnique\nClasses: Rogue\nEngrave your pants with the Between the Eyes rune:\n\n\nRanged Finishing move that causes damage per combo point, increased by Attack Power, and Stuns the target:\n\n 1 point:   [53 / 100 * ( + )] to [81 / 100 * ( + )] damage, 1 sec Stun\n 2 points: [53 / 100 * ( +* 2)] to [81 / 100 * ( +* 2)] damage, 2 sec Stun\n 3 points: [53 / 100 * ( +* 3)] to [81 / 100 * ( +* 3)] damage, 3 sec Stun\n 4 points: [53 / 100 * ( +* 4)] to [81 / 100 * ( +* 4)] damage, 4 sec Stun\n 5 points: [53 / 100 * ( +* 5)] to [81 / 100 * ( +* 5)] damage, 5 sec Stun\n\n Cooldown shared with Kidney Shot.\n\"Teaches you a new Engraving ability.\""},
[204270] = {name = "Fathom Core", additional_info = "Unique"},
[204441] = {name = "Rune of Blood Frenzy", additional_info = "Binds when picked up\nUnique\nClasses: Warrior\nEngrave your chest with the Blood Frenzy rune:\n\n\nEach time you deal Bleed damage, you gain 3 Rage.\n\"Teaches you a new Engraving ability.\""},
[204476] = {name = "Severed Kobold Head", additional_info = "Binds when picked up\nUnique\n\"A grim trophy. May interest the right collector...\""},
[204477] = {name = "Severed Murloc Head", additional_info = "Binds when picked up\nUnique\n\"A grim trophy. May interest the right collector...\""},
[204478] = {name = "Severed Gnoll Head", additional_info = "Binds when picked up\nUnique\n\"A grim trophy. May interest the right collector...\""},
[204688] = {name = "Monster Hunter's First Rune Fragment", additional_info = "Use: Combine with 2 other pieces to make the full rune."},
[204689] = {name = "Monster Hunter's Second Rune Fragment", additional_info = "Use: Combine with 2 other pieces to make the full rune."},
[204690] = {name = "Monster Hunter's Third Rune Fragment", additional_info = "Use: Combine with 2 other pieces to make the full rune."},
[204703] = {name = "Rune of Devastate", additional_info = "Binds when picked up\nUnique\nClasses: Warrior\nEngrave your gloves with the Devastate rune:\n\n\nWhile you are in Defensive Stance and have a shield equipped, Sunder Armor also deals 60% weapon damage, increased by 6% per application of Sunder Armor already on the target.\n\"Teaches you a new Engraving ability.\""},
[204716] = {name = "Rune of Frenzied Assault", additional_info = "Binds when picked up\nUnique\nClasses: Warrior\nEngrave your pants with the Frenzied Assault rune:\n\n\nWhile wielding 2-handed weapons, your attack speed is increased by 20%.\n\"Teaches you a new Engraving ability.\""},
[204795] = {name = "Rune of Shadowstrike", additional_info = "Binds when picked up\nUnique\nClasses: Rogue\nEngrave your gloves with the Shadowstrike rune:\n\n\nTeleport behind your target and strike, causing 150% weapon damage to the target.  Must be stealthed.  Awards 1 combo point.\n\"Teaches you a new Engraving ability.\""},
[204804] = {name = "Hydraxian Bangles", additional_info = "Binds when picked up\nWrist Mail\n95 Armor\n+4 Strength\n+7 Stamina\nDurability 40 / 40\nRequires Level 25"},
[204806] = {name = "Rune of Victory Rush", additional_info = "Binds when picked up\nUnique\nClasses: Warrior\nEngrave your gloves with the Victory Rush rune:\n\n\nInstantly attack the target causing (1 + Attack power * 45 / 100) damage and healing you for 10% of your maximum health.  Only useable within 20 sec after you kill an enemy that yields experience or honor.\n\"Teaches you a new Engraving ability.\""},
[204807] = {name = "Fathomblade", additional_info = "Binds when picked up\nTwo-Hand Sword\n71 - 107 Damage Speed 3.60\n(24.72 damage per second)\nDurability 100 / 100\nRequires Level 25\nChance on hit: Blasts all enemies in front of you with pressurized water.\nEquip: Improves your chance to hit with spells and with melee and ranged attacks by 1%.\n\"The sound of crashing waves echo with every swing.\""},
[204809] = {name = "Rune of Furious Thunder", additional_info = "Binds when picked up\nUnique\nClasses: Warrior\nEngrave your pants with the Furious Thunder rune:\n\n\nThunder Clap now increases the time between attacks by an additional 6%, can be used in any stance, and deals 50% increased threat.\n\"Teaches you a new Engraving ability.\""},
[204864] = {name = "Azora Apprentice Notes", additional_info = "Binds when picked up\nUnique (6)\nUse: Combine 6 Azora Apprentice Notes to create a new engraving recipe."},
[204905] = {name = "Ominous Tome", additional_info = "Binds when picked up\nUnique\nUse: Summon Soboz\n\"Bring the jaw of a wolf and the blood of a gnoll to the belly of the lamb. Then, begin the incantation.\""},
[204906] = {name = "Gnoll Blood", additional_info = "Unique\n\"A reagent for use in a summoning ritual\""},
[204907] = {name = "Wolf Jawbone", additional_info = "Unique\n\"A reagent for use in a summoning ritual\""},
[204910] = {name = "Monster - Trident, Naga (Gold)", additional_info = "Binds when picked up\nTwo-Hand Polearm\n2 - 4 Damage Speed 3.00\n(1.00 damage per second)\nDurability 20 / 20"},
[204912] = {name = "Rune of Grace", additional_info = "Binds when picked up\nUnique\nClasses: Warlock\nEngrave your pants with the Demonic Grace rune:\n\n\nSurge with fel energy, increasing your pet's and your own dodge chance by 30%, and your chance to critically strike with all attacks by 30%. Lasts 6 sec.\n\"Teaches you a new Engraving ability.\""},
[205019] = {name = "Tainted Soul Shard", additional_info = "Binds when picked up\nUnique"},
[205020] = {name = "Pure Soul Shard", additional_info = "Binds when picked up\nUnique"},
[205022] = {name = "Rune of Soul Siphon", additional_info = "Binds when picked up\nUnique\nClasses: Warlock\nEngrave your chest or robe with the Soul Siphon rune:\n\n\nIncreases the amount drained by your Drain Life and Drain Soul spells by an additional 6% for each of your Warlock Shadow effects afflicting the target, up to a maximum of 18% additional effect.\n\"Teaches you a new Engraving ability.\""},
[205181] = {name = "Unidentified Artifact", additional_info = "Binds when picked up\nUnique\n\"Some esoteric magical object. A more experienced Warlock could probably tell you more.\""},
[205182] = {name = "Powerless Artifact", additional_info = "Binds when picked up\nUnique\nUse: Offer your blood to power the artifact."},
[205183] = {name = "Fel-Powered Artifact", additional_info = "Binds when picked up\nUnique"},
[205184] = {name = "Acolyte's Note", additional_info = "Binds when picked up\nUnique\n<Right Click to Read>"},
[205215] = {name = "Rune of Tactics", additional_info = "Binds when picked up\nUnique\nClasses: Warlock\nEngrave your chest or robe with the Demonic Tactics rune:\n\n\nIncreases the melee and spell critical strike chance of you and your pet by 10%.\n\"Teaches you a new Engraving ability.\""},
[205218] = {name = "Libram of Discovery", additional_info = "Binds when picked up\nUnique\nRelic Libram\nClasses: Paladin\nRequires Level 5\nEngrave your chest or robe with the Soul Siphon rune:\n\n\nIncreases the amount drained by your Drain Life and Drain Soul spells by an additional 6% for each of your Warlock Shadow effects afflicting the target, up to a maximum of 18% additional effect.\n\"Achieve a state of Inspiration by slaying 5 foes, then use to learn a new ability.\""},
[205228] = {name = "Rune of Chaos Bolt", additional_info = "Binds when picked up\nUnique\nClasses: Warlock\nEngrave your gloves with the Chaos Bolt rune:\n\n\nSends a bolt of chaotic fire at the enemy, dealing (* 522 / 100) to (* 662 / 100) Fire damage.  Chaos Bolt always hits, cannot be resisted, and its knowledge causes all your Fire spells to pierce through absorption effects. Chaos Bolt gains a high chance to be resisted when used against monsters 4 or more levels above your level.\n\"Teaches you a new Engraving ability.\""},
[205230] = {name = "Rune of Haunting", additional_info = "Binds when picked up\nUnique\nClasses: Warlock\nEngrave your gloves with the Haunt rune:\n\n\nUnleash a ghostly soul on an enemy, dealing (* 251 / 100) to (* 295 / 100) damage, and increasing all Shadow damage over time you deal to that target by 20%. When the Haunt ends or is dispelled, you will be healed for all the damage it dealt to your target.\n\"Teaches you a new Engraving ability.\""},
[205364] = {name = "Acolyte's Knapsack", additional_info = "Binds when picked up\nUnique\nClasses: Warlock\n<Right Click to Open>"},
[205420] = {name = "Libram of Judgement", additional_info = "Binds when picked up\nUnique\nRelic Libram\nClasses: Paladin\nEngrave your gloves with the Crusader Strike rune:\n\n\nAn instant strike that causes 75% weapon damage and regenerates 2% of your maximum mana.\n\"Learn a new ability after unleashing 10 seals onto your enemies\""},
[205683] = {name = "Rune of Rebuke", additional_info = "Binds when picked up\nUnique\nClasses: Paladin\nEngrave your pants with the Rebuke\n rune:\n\n\nInterrupts spellcasting and prevents any spell in that school from being cast for 2 sec.\n\"Teaches you a new Engraving ability.\""},
[205685] = {name = "Rune of Aegis", additional_info = "Binds when picked up\nUnique\nClasses: Paladin\nEngrave your chest with the Aegis rune:\n\n\nIncreases your block value by 30% and damaging melee and ranged attacks against you have a 10% chance to increase your chance to block by 30%.  Lasts 10 sec or 5 blocks. Effect not cumulative with Redoubt.\n\"Teaches you a new Engraving ability.\""},
[205863] = {name = "Corrupted Libram", additional_info = "Classes: Paladin"},
[205864] = {name = "Charred Note", additional_info = "Binds when picked up\nUnique\nClasses: Paladin\n<Right Click to Read>"},
[205897] = {name = "Rune of Martyrdom", additional_info = "Binds when picked up\nUnique\nClasses: Paladin\nEngrave your chest with the Seal of Martyrdom rune:\n\n\nFills you with holy spirit for 30 sec, causing each of your melee attacks to deal 30% weapon damage to your target, but you lose health equal to 10% of the damage inflicted. While this seal is active, your party and raid members within 40 yards each gain mana equal to 20% of damage you take from this seal.\n\n Unleashing this Seal's energy will judge an enemy, instantly causing 70% weapon damage at the cost of health equal to 10% of the damage inflicted.\n\"Teaches you a new Engraving ability.\""},
[205905] = {name = "Memory of a Devout Champion", additional_info = "Binds when picked up\nUnique\nClasses: Priest\nEngrave your chest or robe with the Twisted Faith rune:\n\n\nMind Flay and Mind Blast deal 50% increased damage to targets afflicted with your Shadow Word: Pain.\nUse: Focus on the Memory to learn a new spell.  Requires a mind cleared by meditating on the spiritual mysteries of Azeroth."},
[205932] = {name = "Prophecy of a King's Demise", additional_info = "Binds when picked up\nUnique\nClasses: Priest\nEngrave your gloves with the Shadow Word: Death rune:\n\n\nA word of dark binding that inflicts (* 532 / 100) to (* 620 / 100) Shadow damage to the target.  If the target is not killed by Shadow Word: Death, the caster takes damage equal to the damage inflicted upon the target.\nUse: Focus on the Prophecy to learn a new spell.  Requires a mind focused by meditating on two spiritual mysteries of Azeroth."},
[205940] = {name = "Memory of a Dark Purpose", additional_info = "Binds when picked up\nUnique\nClasses: Priest\nEngrave your chest or robe with the Void Plague rune:\n\n\nAfflicts the target with a disease that causes (* 117 / 100 * 6) Shadow damage over 18 sec.\nUse: Focus on the Memory to learn a new spell.  Requires a mind cleared by meditating on the spiritual mysteries of Azeroth."},
[205942] = {name = "Chimaeric Epiphany", additional_info = "Engrave your pants with the Prayer of Mending rune:\n\n\nPlaces a spell on the target that heals them for (* 74 / 100) the next time they take damage or receive healing.  When the heal occurs, Prayer of Mending jumps to a party or raid member within 20 yards.  Jumps up to 5 times and lasts 30 sec after each jump.  This spell can only be placed on one target at a time."},
[205943] = {name = "Prophecy of a Desecrated Citadel", additional_info = "Unique\nEngrave your pants with the Homunculi rune:\n\n\nBreak off splinters of your soul to animate 3 miniature copies of yourself that attempt to attack your current target with a mace, sword, and axe, reducing the attack speed, attack power, and armor respectively of any target they hit.\nUse: Focus on the Prophecy to learn a new spell.  Requires a mind focused by meditating on two spiritual mysteries of Azeroth."},
[205944] = {name = "Reciprocal Epiphany", additional_info = "Binds when picked up\nUnique\nClasses: Priest\nEngrave your pants with the Prayer of Mending rune:\n\n\nPlaces a spell on the target that heals them for (* 74 / 100) the next time they take damage or receive healing.  When the heal occurs, Prayer of Mending jumps to a party or raid member within 20 yards.  Jumps up to 5 times and lasts 30 sec after each jump.  This spell can only be placed on one target at a time.\n\"Learn a new Engraving ability.\""},
[205945] = {name = "Memory of an Imprisoned Savior", additional_info = "Binds when picked up\nUnique\nClasses: Priest\nEngrave your pants with the Shared Pain rune:\n\n\nYour Shadow Word: Pain now also afflicts up to 2 additional nearby targets within 15 yards.\nUse: Focus on the Memory to learn a new spell.  Requires a mind cleared by meditating on the spiritual mysteries of Azeroth."},
[205946] = {name = "Memory of a Leader's Betrayal", additional_info = "Binds when picked up\nUnique\nClasses: Priest\nUse: Focus on the Memory to learn a new spell.  Requires a mind cleared by meditating on the spiritual mysteries of Azeroth."},
[205947] = {name = "Prophecy of a Desecrated Citadel", additional_info = "Binds when picked up\nUnique\nClasses: Priest\nEngrave your pants with the Homunculi rune:\n\n\nBreak off splinters of your soul to animate 3 miniature copies of yourself that attempt to attack your current target with a mace, sword, and axe, reducing the attack speed, attack power, and armor respectively of any target they hit.\nUse: Focus on the Prophecy to learn a new spell.  Requires a mind focused by meditating on two spiritual mysteries of Azeroth."},
[205948] = {name = "Anodyne Epiphany", additional_info = nil},
[205949] = {name = "Manifold Epiphany", additional_info = "Engrave your gloves with the Circle of Healing rune:\n\n\nHeals all of target player's party members within 40 yards of target player for (* 130 / 100) to (* 144 / 100)."},
[205950] = {name = "Tenebrous Epiphany", additional_info = "Binds when picked up\nUnique\nClasses: Priest\nEngrave your gloves with the Mind Sear rune:\n\n\nCauses an explosion of shadow magic around the enemy target, causing (70 / 100 *) to (78 / 100 *) Shadow damage every 1 sec for 5 sec to all enemies within 10 yards around the target.\n\"Learn a new Engraving ability.\""},
[205951] = {name = "Memory of a Troubled Acolyte", additional_info = "Binds when picked up\nUnique\nClasses: Priest\nEngrave your gloves with the Penance rune:\n\n\nLaunches a volley of holy light at the target, causing (* 128 / 100) Holy damage to an enemy, or (* 85 / 100) healing to an ally, instantly and every 1 sec for 2 sec.\nUse: Focus on the Memory to learn a new spell.  Requires a mind cleared by meditating on the spiritual mysteries of Azeroth."},
[205952] = {name = "Memory of a Shattered World", additional_info = "Use: Focus on the Memory to learn a new spell.  Requires a mind cleared by meditating on the spiritual mysteries of Azeroth."},
[205953] = {name = "Prophecy of a Broken Vow", additional_info = "Binds when picked up\nUnique\nClasses: Priest\nUse: Focus on the Prophecy to learn a new spell.  Requires a mind focused by meditating on two spiritual mysteries of Azeroth."},
[205961] = {name = "Mulgore Bird Meat", additional_info = "Unique\nUse: Place as bait near a mountain cat's dwelling."},
[205979] = {name = "Rune of Flanking", additional_info = "Binds when picked up\nUnique\nClasses: Hunter\nEngrave your pants with the Flanking Strike rune:\n\n\nYou and your pet deal simultaneous instant 100% melee damage. Afterward, your Mongoose Bite and Raptor Strike deal 10% increased damage for 10 sec, stacking up to 3 times. Raptor Strike has a 20% chance to reset the cooldown on Flanking Strike.\n\"Teaches you a new Engraving ability.\""},
[205995] = {name = "Prairie Dog Musk", additional_info = "Classes: Hunter\nUse: Your Tame Beast ability also works on prairie dogs (as companion pet) (10 Min Cooldown)"},
[206032] = {name = "Rune of Carve", additional_info = "Binds when picked up\nUnique\nClasses: Hunter\nEngrave your gloves with the Carve rune:\n\n\nA sweeping attack that strikes all enemies in front of you for 50% weapon damage.\n\"Teaches you a new Engraving ability.\""},
[206155] = {name = "Rune of Marksmanship", additional_info = "Binds when picked up\nUnique\nClasses: Hunter\nEngrave your chest or robe with the Master Marksman rune:\n\n\nIncreases your critical strike chance by 5%, and reduces the Mana cost of all your Shot abilities by 25%.\n\"Teaches you a new Engraving ability.\""},
[206157] = {name = "Seaforium Mining Charge", additional_info = "Quest Item\nUnique (5)"},
[206159] = {name = "Venture Co Disguise", additional_info = "Quest Item\n\"It doesn't seem like much of a disguise...\""},
[206168] = {name = "Rune of the Chimera", additional_info = "Binds when picked up\nUnique\nClasses: Hunter\nEngrave your gloves with the Chimera Shot rune:\n\n\nYou deal 100% weapon damage, refreshing the current Sting on your target and triggering an effect:\n\n Serpent Sting - Instantly deals 40% of the damage done by your Serpent Sting.\n\n Viper Sting - Instantly restores mana to you equal to 60% of the total amount drained by your Viper Sting.\n\n Scorpid Sting - Attempts to Disarm the target for 10 sec. This effect cannot occur more than once per 1 minute.\n\"Teaches you a new Engraving ability.\""},
[206169] = {name = "Rune of Explosive Shot", additional_info = "Binds when picked up\nUnique\nClasses: Hunter\nEngrave your gloves with the Explosive Shot rune:\n\n\nYou fire an explosive charge into the enemy target, dealing (Ranged attack power * 0.039 + 36 / 100 *)-(Ranged attack power * 0.039 + 54 / 100 *) Fire damage to all enemies within 8 yards. The charge will deal damage again every second for an additional 2 sec. Cooldown shared with Arcane Shot.\n\"Teaches you a new Engraving ability.\""},
[206170] = {name = "Windfury Cone", additional_info = "Quest Item"},
[206175] = {name = "Pine Salve", additional_info = "Quest Item\nUnique"},
[206176] = {name = "Mortar and Pestle", additional_info = "Quest Item\nUnique\nUse: Grind 8 Windfury Cones together to create a venomous weapon salve.  In theory."},
[206177] = {name = "Pine Nut Butter", additional_info = "Binds when picked up\nUse: Restores 61.2 health over 18 sec.  Must remain seated while eating.  If you spend at least 10 seconds eating you will become well fed and gain 2 Stamina and Spirit for 15 min."},
[206264] = {name = "Rune of Inspiration", additional_info = "Binds when picked up\nUnique\nClasses: Paladin\nEngrave your pants with the Inspiration Exemplar rune:\n\n\nYour inspiring presence periodically dispels Fear and Sleep effects on nearby party members.\n\"Teaches you a new Engraving ability.\""},
[206344] = {name = "Knife Set", additional_info = "Quest Item\nUnique\nUse: Attempt to fillet a Raw Brilliant Smallfish."},
[206345] = {name = "Fish Chunks", additional_info = "Quest Item\nUnique"},
[206376] = {name = "Bulwark Icon", additional_info = "Binds when picked up\nUnique\nRelic Totem\nClasses: Shaman\nRequires Level 3\nEngrave your chest or robe with the Shield Mastery rune:\n\n\nEach time you Block, you regenerate mana equal to 8% of your maximum mana and you gain Armor equal to 30% of your shield's armor value, stacking up to 5 times. You also always gain 10% increased chance to Block and 15% increased Block value.\n\"Learn a new ability after hitting enemies 25 times with Rockbiter Weapon.\""},
[206381] = {name = "Dyadic Icon", additional_info = "Binds when picked up\nUnique\nRelic Totem\nClasses: Shaman\nRequires Level 3\nEngrave your chest or robe with the Overload rune:\n\n\nGives your Lightning Bolt, Chain Lightning, Chain Heal, Healing Wave, and Lava Burst spells a 50% chance to cast a second, similar spell on the same target at no additional cost that causes half damage or healing and no threat.\n\"Learn a new ability after receiving Nature damage 10 times.\""},
[206382] = {name = "Tempest Icon", additional_info = "Binds when picked up\nUnique\nRelic Totem\nClasses: Shaman\nRequires Level 20\nEngrave your gloves with the Water Shield rune:\n\n\nThe caster is surrounded by 3 globes of water, granting 1% of your maximum mana per 5 sec.  When a spell, melee or ranged attack hits the caster, 4% of maximum mana is restored to the caster. This expends one water globe.  Only one globe will activate every few seconds.  Lasts 10 min.  Only one Elemental Shield can be active on the Shaman at any one time.\n\"Learn a new ability after hitting 10 non-player enemies with 3 different elements (Nature, Frost, Fire).\""},
[206383] = {name = "Lithic Icon", additional_info = "Binds when picked up\nUnique\nRelic Totem\nClasses: Shaman\nRequires Level 3\nEngrave your pants with the Earth Shield rune:\n\n\nProtects the target with an earthen shield, reducing casting or channeling time lost when damaged by 30%  and causing attacks to heal the shielded target for 100.  This effect can only occur once every few seconds.  3 charges.  Lasts 10 min.  Earth Shield can only be placed on one target at a time and only one Elemental Shield can be active on a target at a time.\n\"Learn a new ability after blocking 20 attacks with your shield.\""},
[206384] = {name = "Astral Icon", additional_info = "Binds when picked up\nUnique\nRelic Totem\nClasses: Shaman\nRequires Level 3\n\"Learn a new ability after hitting enemies 25 times with Rockbiter Weapon.\""},
[206385] = {name = "Clastic Icon", additional_info = "Binds when picked up\nUnique\nRelic Totem\nClasses: Shaman\nRequires Level 3\nEngrave your pants with the Way of Earth rune:\n\n\nWhile Rockbiter Weapon is active on your main hand weapon, you deal 50% increased threat, gain 30% increased health, take 10% reduced damage, gain 6% reduced chance to be critically hit by melee attacks, and Earth Shock taunts targets to attack you and has a separate cooldown from other Shock spells but has its range reduced to melee range.\n\"Learn a new ability after defeating 20 enemies with Earth Shock.\""},
[206386] = {name = "Galvanic Icon", additional_info = "Binds when picked up\nUnique\nRelic Totem\nClasses: Shaman\nRequires Level 3\nEngrave your chest or robe with the Shield Mastery rune:\n\n\nEach time you Block, you regenerate mana equal to 8% of your maximum mana and you gain Armor equal to 30% of your shield's armor value, stacking up to 5 times. You also always gain 10% increased chance to Block and 15% increased Block value.\n\"Learn a new ability after defeating enemies 10 times with Lightning Bolt.\""},
[206387] = {name = "Kajaric Icon", additional_info = "Binds when picked up\nUnique\nRelic Totem\nClasses: Shaman\nEngrave your gloves with the Lava Burst rune:\n\n\nYou hurl molten lava at the target, dealing (469 / 100 *) to (605 / 100 *) Fire damage. If your Flame Shock is on the target, Lava Burst will deal a critical strike.\n\"Learn a new ability after taking damage from lava 5 times. (Reduces damage from some sources of lava)\""},
[206388] = {name = "Sulfurous Icon", additional_info = "Binds when picked up\nUnique\nRelic Totem\nClasses: Shaman\nRequires Level 3\nEngrave your gloves with the Molten Blast rune:\n\n\nBlast up to 4 enemies in a cone in front of you for (* 72 / 100 + 5 / 100 * Attack power) to (* 108 / 100 + 5 / 100 * Attack power) Fire damage. This ability generates a high amount of threat. Flame Shock periodic damage has a 10% chance to reset the cooldown on Molten Blast.\n\"Learn a new ability after defeating 10 enemies with Earth Shock.\""},
[206389] = {name = "Brimstone Icon", additional_info = "Binds when picked up\nUnique\nRelic Totem\nClasses: Shaman\nRequires Level 3\n\"Learn a new ability after hitting enemies 25 times with Rockbiter Weapon.\""},
[206390] = {name = "Ichthyan Icon", additional_info = "Binds when picked up\nUnique\nRelic Totem\nClasses: Shaman\nRequires Level 3\nEngrave your gloves with the Water Shield rune:\n\n\nThe caster is surrounded by 3 globes of water, granting 1% of your maximum mana per 5 sec.  When a spell, melee or ranged attack hits the caster, 4% of maximum mana is restored to the caster. This expends one water globe.  Only one globe will activate every few seconds.  Lasts 10 min.  Only one Elemental Shield can be active on the Shaman at any one time.\n\"Learn a new ability after hitting enemies 25 times with Rockbiter Weapon.\""},
[206391] = {name = "Syzygic Icon", additional_info = "Binds when picked up\nUnique\nRelic Totem\nClasses: Shaman\nRequires Level 3\n\"Learn a new ability after hitting enemies 25 times with Rockbiter Weapon.\""},
[206466] = {name = "Prairie Crown", additional_info = "Use: Awaken a spirit of the plains"},
[206469] = {name = "Prairie Flower", additional_info = "Classes: Druid\nUse: Combine 3 Prairie Flowers to make a crown."},
[206954] = {name = "Idol of Ursine Rage", additional_info = "Binds when picked up\nUnique\nRelic Idol\nClasses: Druid\nRequires Level 10\nEngrave your gloves with the Mangle rune:\n\n\nMangle the target for 160% normal damage and cause the target to take 30% additional damage from Bleed effects and Shred for 1 min. This ability benefits from and triggers all effects associated with Claw and Maul.\n\"Learn a new ability after keeping your rage in Bear Form at 50 or higher for 60 seconds\""},
[206963] = {name = "Rune of Natural Potential", additional_info = "Binds when picked up\nUnique\nClasses: Druid\nEngrave your chest or robe with the Living Seed rune:\n\n\nWhen you critically heal your target with any healing spell you plant a Living Seed on the target for 30% of the amount healed. The Living Seed will bloom when the target is next attacked. Lasts 15 sec.\n\"Teaches you a new Engraving ability.\""},
[206966] = {name = "Lakeweed Bulb", additional_info = "Binds when picked up\nUnique\nClasses: Druid\n\"Grows in watery soil\""},
[206970] = {name = "Rune of Life", additional_info = "Binds when picked up\nUnique\nClasses: Druid\nEngrave your pants with the Lifebloom rune:\n\nReduces the global cooldown on your  Rejuvenation and Lifebloom abilities by 0.5 sec and you gain the Lifebloom ability:\n\n\nHeals the target for (4 / 100 * 7 *) over 7 sec.  When Lifebloom completes its duration or is dispelled, the target instantly heals for (57 / 100 *) and the Druid regains half the cost of the spell.  This effect can stack up to 3 times on the same target.\n\"Teaches you a new Engraving ability.\""},
[206975] = {name = "Artifact Storage Key", additional_info = "Unique\n\"Opens Artifact Storage chest\""},
[206985] = {name = "Echo of the Alpha", additional_info = "Binds when picked up\nUnique\nClasses: Shaman\nRequires Level 3\n\"Learn a new ability.\""},
[206989] = {name = "Rune of the Sun", additional_info = "Binds when picked up\nUnique\nClasses: Druid\nEngrave your gloves with the Sunfire rune:\n\n\nBurns the enemy for (130 */ 100) to (152 */ 100) Nature damage and then an additional (65 * 4 */ 100) Nature damage over 12 sec.\n\n In addition, while in Bear Form, Cat Form, or Dire Bear Form, your Moonfire is replaced with Sunfire (Bear) or Sunfire (Cat). This spell benefits from and triggers all effects associated with Moonfire.\n\n Sunfire (Bear)\nBurns the enemy for (130 */ 100) to (152 */ 100) Nature damage and then an additional (65 * 4 */ 100) Nature damage over 12 sec.\n\n Sunfire (Cat)\nBurns the enemy for (130 */ 100) to (152 */ 100) Nature damage and then an additional (65 * 4 */ 100) Nature damage over 12 sec. Awards 1 combo point.\n\"Teaches you a new Engraving ability.\""},
[206992] = {name = "Rune of Skull Bash", additional_info = "Binds when picked up\nUnique\nClasses: Druid\nEngrave your pants with the Skull Bash rune:\n\n\nCharge to a target within 13 yards and bash the target's skull, interrupting spellcasting and preventing any spell in that school from being cast for 2 sec. Shares a cooldown with Feral Charge.\n\"Teaches you a new Engraving ability.\""},
