[208414] = {name = "Lunar Idol", additional_info = "Binds when picked up\nUnique\nRelic Idol\nClasses: Druid\nRequires Level 4\nEngrave your chest or robe with the Fury of Stormrage rune:\n\n\nReduces the mana cost of Wrath by 100% and each time you deal damage with Wrath you have a 12% chance for your next cast of Healing Touch within 15 sec to be instant.\n\"Defeat 6 creatures affected by your Moonfire, then use to learn a new ability.\""},
