[208687] = {name = "Rune of Lacerate", additional_info = "Binds when picked up\nUnique\nClasses: Druid\nEngrave your gloves with the Lacerate\n rune:\n\n\nLacerates the enemy target, making them bleed for (* 20 / 100 * 5) damage over 15 sec plus 20% weapon damage per existing application of Lacerate on the target. Causes a high amount of threat. This effect stacks up to 5 times on the same target.\n\"Teaches you a new Engraving ability.\""},
[208689] = {name = "Ferocious Idol", additional_info = "Binds when picked up\nUnique\nRelic Idol\nClasses: Druid\nRequires Level 20\nEngrave your pants with the Savage Roar rune:\n\n\nFinishing move that increases physical damage done by 30% while in Cat Form.  Lasts longer per combo point:\n 1 point  : 14 seconds\n 2 points: 19 seconds\n 3 points: 24 seconds\n 4 points: 29 seconds\n 5 points: 34 seconds\n\"Deal 20 instances of bleeding damage to humanoids, then use this idol to learn a new ability.\""},
[208701] = {name = "Rune of Beast Mastery", additional_info = "Binds when picked up\nUnique\nClasses: Hunter\nEngrave your gloves with the Beast Mastery rune:\n\n\nYour pet's damage and health are increased by 20%, and its Focus regeneration by 50%. In addition, your pet's Growl now also Taunts the target to attack it for 3 sec.\n\"Teaches you a new Engraving ability.\""},
[208739] = {name = "Horde Warbanner", additional_info = "Binds when picked up\nUnique\nClasses: Warrior\n\"Plant this in the soil of your enemies\""},
[208741] = {name = "Rune of Endless Rage", additional_info = "Binds when picked up\nUnique\nClasses: Warrior\nEngrave your gloves with the Endless Rage rune:\n\n\nYou generate 25% more Rage from all damage you deal.\n\"Teaches you a new Engraving ability.\""},
[208743] = {name = "Soul of Greed", additional_info = "Binds when picked up\nUnique\nClasses: Warlock"},
[208744] = {name = "Rune of Shadowbolts", additional_info = "Binds when picked up\nUnique\nClasses: Warlock\nEngrave your gloves with the Shadow Bolt Volley rune:\n\n\nYour Shadow Bolt now strikes up to 5 targets within a chain distance of 10 yards, but for 20% reduced damage.\n\"Teaches you a new Engraving ability.\""},
[208749] = {name = "Gnarlpine Stash Key", additional_info = "Unique\n\"A tree branch is crudely carved upon the handle.\""},
[208750] = {name = "Rune of Channeling", additional_info = "Binds when picked up\nUnique\nClasses: Warlock\nEngrave your chest or robe with the Master Channeler rune:\n\n\nYour Drain Life is no longer channeled, lasts 15 sec with a 15 sec cooldown, costs 100% more mana, and heals you for 50% more each time it deals damage.\n\"Teaches you a new Engraving ability.\""},
[208753] = {name = "Spell Notes: Regeneration", additional_info = "Binds when picked up\nUnique\nClasses: Mage\nEngrave your chest or robe with the Regeneration rune:\n\n\nHeals the target for (* 42 / 100 * 3) health over 3 sec and applies Temporal Beacon for 30 sec.\n\n Temporal Beacon\n\nRecords the subject's space-time position. 80% of all Arcane damage done by the caster will be converted to chronomantic healing on each of the caster's current Temporal Beacon targets. This healing is reduced by 50% on self, and also reduced by 80% when damage is done by Arcane Explosion.\n\"Teaches you a new Engraving ability.\""},
[208754] = {name = "Spell Notes: TENGI RONEERA", additional_info = "Binds when picked up\nUnique\nClasses: Mage\nUse: Decipher the spell notes with a Comprehension Charm to learn a new Engraving spell."},
[208758] = {name = "Earthen Rune", additional_info = "Binds when picked up\nUnique\nClasses: Shaman\nEngrave your pants with the Way of Earth rune:\n\n\nWhile Rockbiter Weapon is active on your main hand weapon, you deal 50% increased threat, gain 30% increased health, take 10% reduced damage, gain 6% reduced chance to be critically hit by melee attacks, and Earth Shock taunts targets to attack you and has a separate cooldown from other Shock spells but has its range reduced to melee range.\n\"Teaches you a new Engraving ability.\""},
[208760] = {name = "Glade Crown", additional_info = "Use: Awaken a spirit of the plains"},
[208764] = {name = "Rune of the Banshee", additional_info = "Unique\nClasses: Priest"},
[208765] = {name = "Helping Hand", additional_info = "Binds when picked up\nUnique\nClasses: Priest\n\"The hand will open for a savior\""},
[208766] = {name = "Helping Hand", additional_info = "Binds when picked up\nUnique\nClasses: Priest\n\"The hand has opened for you\"\n<Right Click to Open>"},
[208767] = {name = "Rune of Mending", additional_info = "Unique\nClasses: Priest\nEngrave your pants with the Prayer of Mending rune:\n\n\nPlaces a spell on the target that heals them for (* 74 / 100) the next time they take damage or receive healing.  When the heal occurs, Prayer of Mending jumps to a party or raid member within 20 yards.  Jumps up to 5 times and lasts 30 sec after each jump.  This spell can only be placed on one target at a time.\n\"Teaches you a new Runecarving ability.\""},
[208768] = {name = "Buccaneer's Matchbox", additional_info = "Binds when picked up\nUnique\nClasses: Rogue\n\"Used to ignite flammable materials\""},
[208771] = {name = "Rune of Blade Dance", additional_info = "Binds when picked up\nUnique\nClasses: Rogue\nEngrave your pants with the Blade Dance rune:\n\n\nFinishing move that increases your Parry chance by 10%.  Lasts longer per combo point:\n\n 1 point  : 14 seconds\n 2 points: 18 seconds\n 3 points: 22 seconds\n 4 points: 26 seconds\n 5 points: 30 seconds\n\"Teaches you a new Engraving ability.\""},
[208772] = {name = "Rune of Saber Slash", additional_info = "Binds when picked up\nUnique\nClasses: Rogue\nEngrave your gloves with the Saber Slash rune:\n\n\nViciously slash an enemy for 100% weapon damage, and cause the target to bleed for (Attack power * 5 / 100) damage every 2 sec for 12 sec, stacking up to 3 times.  Awards 1 combo point.\n\n Saber Slash benefits from all talents and effects that trigger from or modify Sinister Strike.\n\"Teaches you a new Engraving ability.\""},
[208773] = {name = "Fishing Harpoon", additional_info = "Binds when picked up\nClasses: Warrior , Hunter\nUse: Throw harpoon at target (40 yd. range)\n\"A must-have for the aspiring shark hunter!\""},
[208777] = {name = "Rune of the Sniper", additional_info = "Binds when picked up\nUnique\nClasses: Hunter\nEngrave your pants with the Sniper Training rune:\n\n\nYour Shot abilities gain 10% increased critical strike chance while you have not moved for the last 6 sec.\n\"Teaches you a new Engraving ability.\""},
[208778] = {name = "Rune of Quick Strike", additional_info = "Binds when picked up\nUnique\nClasses: Warrior\nEngrave your gloves with the Quick Strike rune:\n\n\nA reckless instant melee attack with your two-handed weapon dealing (Attack power * 15 / 100) to (Attack power * 25 / 100) physical damage. This ability benefits from and triggers all effects associated with Heroic Strike.\n\"Teaches you a new Engraving ability.\""},
[208799] = {name = "Spell Notes: Living Bomb", additional_info = "Binds when picked up\nUnique\nClasses: Mage\nEngrave your gloves with the Living Bomb rune:\n\n\nThe target becomes a Living Bomb, taking (* 85 / 100 * 4) Fire damage over 12 sec.  After 12 sec or when the spell is dispelled, the target explodes dealing (* 171 / 100) Fire damage to all enemies within 10 yards\n\"Teaches you a new Engraving ability.\""},
[208800] = {name = "Baxtan: On Destructive Magics", additional_info = "Unique\n\"The writings of a notable Goblin mage. A fine addition to any library's collection.\""},
[208823] = {name = "Offering Coin", additional_info = "Binds when picked up\nClasses: Priest\nUse: Toss into a nearby well to make a wish"},
