[209816] = {name = "Fetish of Mischief", additional_info = "Binds when picked up\nUnique\nTrinket\nClasses: Warlock\nRequires Level 25\nEquip: Increases the damage of your Imp's Firebolt spell by 2."},
[209817] = {name = "Voidwalker Brooch", additional_info = "Binds when picked up\nNeck\n+6 Stamina\nRequires Level 25\nEquip: Increased Defense +4."},
[209818] = {name = "Sun-Touched Crescent", additional_info = "Binds when picked up\nOne-Hand Dagger\n15 - 30 Damage Speed 1.20\n(18.75 damage per second)\n+3 Stamina\nDurability 65 / 65\nRequires Level 25\nEquip: Increases damage done by Fire spells and effects by up to 9."},
[209819] = {name = "Wyvern Taming Wand", additional_info = "Binds when picked up\nUnique\nClasses: Hunter\n\"Enables taming of Young Pridewings in Stonetalon Mountains.\""},
[209820] = {name = "Black Shroud Choker", additional_info = "Binds when picked up\nNeck\n+4 Stamina\n+5 Shadow Resistance\nRequires Level 25\nEquip: Increases damage done by Shadow spells and effects by up to 7."},
[209821] = {name = "Ring of Shadowsight", additional_info = "Binds when picked up\nUnique\nFinger\nRequires Level 25\nEquip: Slightly increases your stealth detection."},
[209822] = {name = "Strength of Purpose", additional_info = "Binds when picked up\nMain Hand Mace\n26 - 50 Damage Speed 2.00\n(19.00 damage per second)\n+2 Stamina\n+5 Intellect\n+3 Spirit\nDurability 90 / 90\nRequires Level 25"},
[209823] = {name = "Signet of Beasts", additional_info = "Binds when picked up\nUnique\nFinger\nClasses: Hunter\nRequires Level 25\nEquip: Increases the damage done by your pets by 1%."},
