[209830] = {name = "Ironhide Arbalest", additional_info = "Binds when picked up\nRanged Crossbow\n19 - 37 Damage Speed 1.90\n(14.74 damage per second)\nDurability 80 / 80\nRequires Level 25\nEquip: Increased Defense +3."},
[209836] = {name = "Althalaxx Orb", additional_info = "Binds when picked up\nUnique"},
[209838] = {name = "Hypnotic Crystal", additional_info = "Binds when picked up\nUnique"},
[209840] = {name = "Gnarled Wand of Wild Magic", additional_info = "Binds when picked up\nUnique"},
[209841] = {name = "Wild Magic Essence", additional_info = "Binds when picked up\nUnique\nUse: Imbue a Greater Magic Wand with wild magic."},
[209843] = {name = "Nar'thalas Almanac, Vol. 74", additional_info = "Binds when picked up\nUnique\n\"Arcane research of the ancient quel'dorei. A fine addition to any library's collection.\""},
[209844] = {name = "The Dalaran Digest, Vol. 23", additional_info = "Binds when picked up\nUnique\n\"Arcane research of the Kirin Tor. A fine addition to any library's collection.\""},
[209845] = {name = "Bewitchments and Glamours", additional_info = "Binds when picked up\nUnique\n\"Spells for manipulation and deception. A fine addition to any library's collection.\""},
[209846] = {name = "Secrets of the Dreamers", additional_info = "Binds when picked up\nUnique\n\"Observations and insights on the Emerald Dream. A fine addition to any library's collection.\""},
[209847] = {name = "Arcanic Systems Manual", additional_info = "Binds when picked up\nUnique\n\"Poorly-organized troubleshooting tips for goblin technology. A fine addition to any library's collection.\""},
[209848] = {name = "Goaz Scrolls", additional_info = "Binds when picked up\nUnique\n\"Written in lost Titan script, but nevertheless a fine addition to any library's collection.\""},
[209849] = {name = "Crimes Against Anatomy", additional_info = "Binds when picked up\nUnique\n\"Written by Doctor Krastinov. A questionable addition to any library's collection.\""},
[209850] = {name = "Runes of the Sorcerer-Kings", additional_info = "Binds when picked up\nUnique\n\"A relic of the mighty ogre empires of Draenor. A fine addition to any library's collection.\""},
[209851] = {name = "Fury of the Land", additional_info = "Binds when picked up\nUnique\n\"Closely guarded shamanistic secrets of the Grimtotem clan. A fine addition to any library's collection.\""},
[209852] = {name = "Rune of Kill Command", additional_info = "Binds when picked up\nUnique\nClasses: Hunter\nEngrave your pants with the Kill Command rune:\n\n\nGive the command to kill, increasing your pet's damage done from Claw and Bite by 60% for 30 sec.  Each Claw or Bite done by the pet reduces the damage bonus by 20%.\n\"Teaches you a new Engraving ability.\""},
[209872] = {name = "Dragonslayer's Helm", additional_info = "Binds when picked up\nUnique"},
[209873] = {name = "Dragonslayer's Shield", additional_info = "Binds when picked up\nUnique"},
[209874] = {name = "Dragonslayer's Lance", additional_info = "Binds when picked up\nUnique"},
[210015] = {name = "Rune of Raging Blow", additional_info = "Binds when picked up\nUnique\nClasses: Warrior\nEngrave your chest with the Raging Blow rune:\n\n\nA ferocious strike that deals 100% weapon damage, but can only be used while Enrage, Berserker Rage, or Bloodrage is active.\n\"Teaches you a new Engraving ability.\""},
[210026] = {name = "Symbol of the Third Owl", additional_info = "Binds when picked up\nUnique\nClasses: Druid\n\"You have mastered the domain of the sea.\""},
[210043] = {name = "Symbol of the Second Owl", additional_info = "Binds when picked up\nUnique\nClasses: Druid\n\"Agon's soul is finally at peace.\""},
[210044] = {name = "Symbol of the First Owl", additional_info = "Binds when picked up\nUnique\nClasses: Druid\n\"The mark of a true guardian.\""},
[210045] = {name = "Shadeleaf", additional_info = "Quest Item"},
[210053] = {name = "Dire Wolf Paw", additional_info = "Quest Item"},
[210055] = {name = "Hillsbrad Human Bones", additional_info = "Quest Item"},
[210056] = {name = "Tincture of Waking Death", additional_info = "Quest Item"},
[210080] = {name = "Voodoo Offering", additional_info = "Quest Item\nUnique"},
[210137] = {name = "Rune of Wild Growth", additional_info = "Binds when picked up\nUnique\nClasses: Druid\nEngrave your gloves with the Wild Growth rune:\n\n\nHeals all of target player's party members within 40 yards of target player for (34 / 100 * 7 *) over 7 sec. The amount healed is applied quickly at first, and slows down as Wild Growth reaches its full duration.\n\"Teaches you a new Engraving ability.\""},
[210138] = {name = "Dark Iron Ordinance", additional_info = nil},
[210146] = {name = "Shredder Turbocharger", additional_info = nil},
[210147] = {name = "Shredder Autosalvage Unit", additional_info = "Use: Salvage the wreckage of a shredder for spare parts."},
[210177] = {name = "Ataeric: On Arcane Curiosities", additional_info = "Unique\n\"The writings of a notable Kirin Tor archmage. A fine addition to any library's collection.\""},
[210178] = {name = "Schematic: Shredder Autosalvage Unit", additional_info = "Requires Engineering (135)"},
[210179] = {name = "Spell Notes: ILMEGAI SARRBES", additional_info = "Binds when picked up\nUnique\nUse: Translate the spell notes into a new runecarving recipe.  Requires a reference for the author's shorthand."},
[210183] = {name = "Horn of Xelthos", additional_info = "Binds when picked up\nUnique\n\"It emits a soft and haunting tone.\""},
[210186] = {name = "Breaching Charge", additional_info = "Binds when picked up\nUnique\nUse: Open a heavy gate, goblin-style!"},
[210187] = {name = "Venture Co. Work Order", additional_info = "Binds when picked up\nUnique"},
[210188] = {name = "Shredded Work Order", additional_info = "Binds when picked up\nUnique\n\"Seems to have been damaged in combat.\""},
[210195] = {name = "Unbalanced Idol", additional_info = "Binds when picked up\nUnique\nRelic Idol\nClasses: Druid\nRequires Level 10\nUse: Balance the Powers of the Moon, Emerald Dream, and Wild to learn a new ability."},
[210209] = {name = "Twin Key", additional_info = "Binds when picked up\nUnique\nClasses: Rogue"},
[210210] = {name = "Grizzwerks Defense Industries Founder's Certificate", additional_info = "\"The fine print makes it clear this certificate carries no stock value or legal entitlement. If you put your thumb over that part a vendor might buy it.\""},
[210212] = {name = "Brother's Half-Key", additional_info = "Binds when picked up\nUnique\nUse: Combine Brother and Sister Half-Keys."},
[210213] = {name = "Sister's Half-Key", additional_info = "Binds when picked up\nUnique\nUse: Combine Brother and Sister Half-Keys."},
[210229] = {name = "Rune of Mutilation", additional_info = "Binds when picked up\nUnique\nClasses: Rogue\nEngrave your gloves with the Mutilate rune:\n\n\nInstantly attacks with both weapons for 100% weapon damage plus an additional (100 / 100 *) with each weapon.  Damage is increased by 20% against Poisoned targets.  Awards 2 combo points.\n\n Mutilate benefits from all talents and effects that trigger from or modify Backstab unless otherwise specified.\n\"Teaches you a new Engraving ability.\""},
[210250] = {name = "Engraved Gold Ring", additional_info = "Binds when picked up\nUnique\nFinger\n\"The engraving reads: While __ both __ kneel __ the __ in __ cemetery.\""},
[210251] = {name = "Engraved Silver Ring", additional_info = "Binds when picked up\nUnique\nFinger\n\"The engraving reads: __ wearing __ rings __ before __ statue __ the __\""},
[210252] = {name = "Rune of Shiving", additional_info = "Binds when picked up\nUnique\nClasses: Rogue\nEngrave your gloves with the Shiv rune:\n\n\nInstantly attack with your off-hand weapon to deal normal off-hand weapon damage with a 100% chance to apply the poison from your off-hand weapon to the target. Slower weapons require more energy. Awards 1 combo point.\n\n Shiv benefits from all talents and effects that trigger from or modify Sinister Strike.\n\"Teaches you a new Engraving ability.\""},
[210253] = {name = "Rot Totem", additional_info = "Binds when picked up\nUnique\nUse: Call to the spirits of the elements.\n\"A traditional totem... twisted and gnarled by dark magic, nearly unrecognizable to those that commune with the elements.\""},
[210322] = {name = "Rune of Venom", additional_info = "Binds when picked up\nUnique\nClasses: Rogue\nEngrave your pants with the Envenom rune:\n\n\nFinishing move that deals instant poison damage based on your Deadly Poison doses on the target.  Following the Envenom attack you have a 75% increased frequency of applying Instant Poison for 1 sec plus an additional 1 sec per combo point. One dose is activated per combo point:\n 1 dose:  [( * 100 / 100) * 1 + Attack power * 0.09] damage\n 2 doses: [( * 100 / 100) * 2 + Attack power * 0.18] damage\n 3 doses: [( * 100 / 100) * 3 + Attack power * 0.27] damage\n 4 doses: [( * 100 / 100) * 4 + Attack power * 0.36] damage\n 5 doses: [( * 100 / 100) * 5 + Attack power * 0.45] damage\n\"Teaches you a new Engraving ability.\""},
[210323] = {name = "Safe Combination", additional_info = "Binds when picked up\nUnique\nClasses: Rogue\n\"0-4-5-1\""},
[210329] = {name = "Hillsbrad Treasure Map", additional_info = "Binds when picked up\nUnique\nClasses: Rogue\n\"Follow the river north; past the Alterac Mountains. What you seek lies beneath the falling rapids.\""},
[210330] = {name = "Hot Tip", additional_info = "Binds when picked up\nUnique\n\"Good intel ain't cheap.\"\n<Right Click to Open>"},
[210410] = {name = "Freshwater Snapper Bait", additional_info = "Classes: Hunter\nUse: Toss bait. (5 Min Cooldown)\n\"Throw some overboard to lure out a big one!\""},
[210499] = {name = "Marshroom", additional_info = "Use: Eat (at your own risk)."},
[210500] = {name = "Rune of the Stars", additional_info = "Binds when picked up\nUnique\nClasses: Druid\nEngrave your pants with the Starsurge rune:\n\n\nLaunch surging stellar energies that causes (381 / 100 *) to (467 / 100 *) Arcane damage.\n\n Starsurge benefits from and triggers most talents and effects that trigger or benefit from Wrath or Starfire.\n\"Teaches you a new Engraving ability.\""},
[210534] = {name = "Idol of the Wild", additional_info = "Binds when picked up\nUnique\nRelic Idol\nClasses: Druid\nEngrave your chest or robe with the Wild Strikes rune:\n\n\nWhile you are in Cat Form, Bear Form, or Dire Bear Form, party members within 20 yards gain increased combat ferocity.  Each melee hit has a 20% chance of granting the attacker an extra attack with 20% additional Attack Power. No effect if the party member is already benefitting from Windfury Totem.\n\"Heal 10 different beasts, then use this idol to learn a new ability.\""},
[210568] = {name = "Decrepit Phylactery", additional_info = "Binds when picked up\nUnique\n\"A heinous aura eminates from the artifact.\""},
[210569] = {name = "Rune of Flagellation", additional_info = "Binds when picked up\nUnique\nClasses: Warrior\nEngrave your chest with the Flagellation rune:\n\n\nGain a 25% bonus to Physical damage done for 12 sec after activating Bloodrage or Berserker Rage.\n\"Teaches you a new Engraving ability.\""},
[210573] = {name = "Rune of Consuming Rage", additional_info = "Binds when picked up\nUnique\nClasses: Warrior\nEngrave your pants with the Consumed by Rage rune:\n\n\nEnrages you and grants you a 20% melee damage bonus for 12 sec or up to a maximum of 12 swings after you exceed 80 Rage.\n\"Teaches you a new Engraving ability.\""},
[210589] = {name = "Echo of the Ancestors", additional_info = "Binds when picked up\nUnique\nClasses: Shaman\nRequires Level 3\nEngrave your pants with the Ancestral Guidance rune:\n\n\nFor the next 10 sec, 25% of your damage is converted to healing on up to 3 nearby party members, and 100% of your healing is converted to damage on your most recent Flame Shock target.\n\"Learn a new Engraving ability.\""},
[210596] = {name = "Rune of Cobra Strikes", additional_info = "Binds when picked up\nUnique\nClasses: Hunter\nEngrave your chest or robe with the Cobra Strikes rune:\n\n\nYour critical hits with Shot abilities cause your pet's next 2 special attacks to critically hit.\n\"Teaches you a new Engraving ability.\""},
[210653] = {name = "Rune of Main Gauche", additional_info = "Binds when picked up\nUnique\nClasses: Rogue\nEngrave your gloves with the Main Gauche rune:\n\n\nInstantly strike with your off-hand weapon for normal off-hand weapon damage and increase your chance to parry by 10% for 10 sec.  Awards 1 combo point.\n\n Main Gauche benefits from all talents and effects that trigger from or modify Sinister Strike.\n\"Teaches you a new Engraving ability.\""},
[210654] = {name = "Spell Notes: Rewind Time", additional_info = "Binds when picked up\nUnique\nClasses: Mage\nEngrave your gloves with the Rewind Time rune:\n\n\nYour current target with your Temporal Beacon instantly heals all damage taken over the last 5 seconds. Ineffective on targets that did not have a Temporal Beacon 5 seconds ago.\n\"Teaches you a new Engraving ability.\""},
[210655] = {name = "Spell Notes: TERWEM DINI", additional_info = "Binds when picked up\nUnique\nUse: Decipher the spell notes with a Comprehension Charm to learn a new Engraving spell."},
[210665] = {name = "Mote of Torrential Rage", additional_info = "Binds when picked up\nUnique"},
[210667] = {name = "Mote of Infernal Rage", additional_info = "Binds when picked up\nUnique"},
[210668] = {name = "Mote of Seismic Rage", additional_info = "Binds when picked up\nUnique"},
[210696] = {name = "Rot Bane", additional_info = "Binds when picked up\nMain Hand Sword\n18 - 34 Damage Speed 2.60\n(10.00 damage per second)\nDurability 60 / 60\nClasses: Warrior\nRequires Level 14\n\"Caked in blood, the blade no longer shimmers in the light but instead serves as a warning...\""},
[210708] = {name = "Elixir of Coalesced Regret", additional_info = "Requires Level 20\nUse: Allows the imbiber to speak with the corpse of an individual with unfinished business in the mortal world. Also may cure indigestion. (3 Sec Cooldown)"},
[210709] = {name = "Recipe: Elixir of Coalesced Regret", additional_info = "Requires Alchemy (90)\nUse: Teaches you how to make an Elixir of Coalesced Regret.\nElixir of Coalesced Regret\nRequires Level 20\nUse: Allows the imbiber to speak with the corpse of an individual with unfinished business in the mortal world. Also may cure indigestion. (3 Sec Cooldown)\nRequires Stranglekelp (5), Leaded Vial , Grave Moss (5), Soul Dust"},
[210712] = {name = "Elixir of Insight", additional_info = "Binds when picked up\nUse: Behold a vision at Je'neu's  bonfire."},
[210713] = {name = "Tortured Soul", additional_info = "Binds when picked up\nUnique\nClasses: Warlock\nUse: Make an Offering of Blood to release this Tortured Soul."},
[210724] = {name = "Hirzek's Staff", additional_info = "Binds when picked up"},
[210741] = {name = "Automatic Crowd Pummeler", additional_info = "Binds when picked up\nTwo-Hand Mace\n46 - 70 Damage Speed 2.00\n(29.00 damage per second)\n+16 Strength\n+5 Agility\nDurability 100 / 100\nClasses: Paladin , Shaman , Druid\nRequires Level 35\nUse: Increases your attack speed by 50% for 30 sec. (3 Min Cooldown)\n\"A variety of improvements were made to improve the usability of this year's model.\""},
[210746] = {name = "Rune of Earth Shield", additional_info = "Binds when picked up\nUnique\nClasses: Shaman\nEngrave your pants with the Earth Shield rune:\n\n\nProtects the target with an earthen shield, reducing casting or channeling time lost when damaged by 30%  and causing attacks to heal the shielded target for 100.  This effect can only occur once every few seconds.  3 charges.  Lasts 10 min.  Earth Shield can only be placed on one target at a time and only one Elemental Shield can be active on a target at a time.\n\"Teaches you a new Engraving ability.\""},
[210763] = {name = "Bough of Altek", additional_info = "Binds when picked up\nUnique\n\"A splintered fragment of power. It appears this was once half of a great weapon.\""},
[210765] = {name = "Orb of Des", additional_info = "Binds when picked up\nUnique\n\"Flames and dark magic swirl through the orb, mesmerizing yet deeply concerning. It appears this was once half of a great weapon.\""},
[210771] = {name = "Waylaid Supplies: Copper Bars", additional_info = "Binds when picked up\nUnique: Waylaid Shipment (1)\nUse: Add 20 Copper Bars to complete the shipment.\n\"Deliver to a supply officer for a reward, or replace the missing goods for a larger reward.\""},
[210772] = {name = "Supply Shipment: Copper Bars", additional_info = "Binds when picked up\nUnique: Supply Shipment (1)\n\"Deliver to a supply officer for a substantial reward.\""},
[210773] = {name = "Mantle of the Second War", additional_info = "Binds when equipped\nShoulder Mail\n163 Armor\n+8 Stamina\nDurability 70 / 70\nRequires Level 25\nEquip: Increases damage done by Holy spells and effects by up to 11."},
[210779] = {name = "Plans: Mantle of the Second War", additional_info = "Binds when picked up\nRequires Blacksmithing (150)\nUse: Teaches you how to craft a Mantle of the Second War.\nMantle of the Second War\nBinds when equipped\nShoulder Mail\n163 Armor\n+8 Stamina\nDurability 70 / 70\nRequires Level 25\nEquip: Increases damage done by Holy spells and effects by up to 11.\nRequires Bronze Bar (20), Moss Agate (2), Lesser Moonstone (2), Iridescent Pearl (2), Silver Bar (4)"},
[210781] = {name = "Phoenix Bindings", additional_info = "Binds when equipped\nWrist Cloth\n21 Armor\nDurability 30 / 30\nRequires Level 25\nEquip: Increases damage done by Fire spells and effects by up to 13."},
[210794] = {name = "Shifting Silver Breastplate", additional_info = "Binds when picked up\nUnique-Equipped: Void-Touched (1)\nChest Mail\n238 Armor\n+12 Strength\n+5 Stamina\nDurability 145 / 145\nRequires Level 25\nRequires Blacksmithing (100)\nEquip: This item is infused with the raw power of the Void. When the bearer is attacked this item has a high chance of inflicting a terrible curse, causing the attacker to take additional damage from all sources for 15 seconds. (Proc chance: 25%)\nEquip: Improves your chance to hit with spells and with melee and ranged attacks by 1%."},
[210795] = {name = "Extraplanar Spidersilk Boots", additional_info = "Binds when picked up\nUnique-Equipped: Void-Touched (1)\nFeet Cloth\n35 Armor\n+5 Stamina\n+5 Intellect\n+6 Spirit\nDurability 50 / 50\nRequires Level 25\nRequires Tailoring (100)\nUse: Momentarily enter another plane of existence, instantly reducing threat as well as reducing all damage taken and damage dealt by 30% for 6 sec. (10 Min Cooldown)\nEquip: Increases damage and healing done by magical spells and effects by up to 7.\nEquip: Improves your chance to hit with spells and with melee and ranged attacks by 1%."},
[210811] = {name = "Rune of Primordial Fury", additional_info = "Binds when picked up\nUnique\nClasses: Shaman\nEngrave your pants with the Shamanistic Rage rune:\n\n\nReduces all damage you take by 20% and you regenerate mana every second for 15 sec. Mana regenerated per second is equal to 15% of your Attack Power, 10% of your spell power, or 6% of your healing power, whichever value is greatest. Your party and raid members within 40 yards will also receive 20% of the mana you receive this way.\n\"Teaches you a new Engraving ability.\""},
[210817] = {name = "Rune of Survival", additional_info = "Binds when picked up\nUnique\nClasses: Druid\nEngrave your chest or robe with the Survival of the Fittest rune:\n\n\nReduces the chance you'll be critically hit by melee attacks by 6% and reduces all damage taken by 10%. Damage taken reduced by an additional 10% while in Bear Form or Dire Bear Form.\n\"Teaches you a new Engraving ability.\""},
[210818] = {name = "Rune of Lone Wolf", additional_info = "Binds when picked up\nUnique\nClasses: Hunter\nEngrave your chest or robe with the Lone Wolf rune:\n\n\nYou deal 15% increased damage with all attacks while you do not have an active pet.\n\"Teaches you a new Engraving ability.\""},
[210820] = {name = "Rune of Sacrifice", additional_info = "Binds when picked up\nUnique\nClasses: Paladin\nEngrave your pants with the Divine Sacrifice rune:\n\n\n30% of all damage taken by party members within 30 yards is redirected to the Paladin for 10 sec. Damage which reduces the Paladin below 20% health will break the effect and grant the paladin 10% increased damage and healing done for 10 sec. Divine Sacrifice cannot be used while you are under the effects of Blessing of Protection, Divine Shield, or Divine Protection, and prevents you from being targeted by those abilities while it is active.\n\"Teaches you a new Engraving ability.\""},
[210822] = {name = "Harmonious Epiphany", additional_info = "Binds when picked up\nUnique\nClasses: Priest\nEngrave your chest or robe with the Serendipity rune:\n\n\nHealing with Flash Heal reduces the cast time of your next Lesser Heal, Heal, Greater Heal, or Prayer of Healing by 20% for 20 sec, stacking up to 3 times.\n\"Learn a new Engraving ability.\""},
[210823] = {name = "Rune of Dual Wield Specialization", additional_info = "Binds when picked up\nUnique\nClasses: Shaman\nEngrave your chest or robe with the Dual Wield Specialization rune:\n\n\nIncreases your chance to hit with both spells and melee attacks by 10% while dual wielding and your Stormstrike ability now hits with both weapons while dual wielding.\n\"Teaches you a new Engraving ability.\""},
[210824] = {name = "Rune of the Pact", additional_info = "Binds when picked up\nUnique\nClasses: Warlock\nEngrave your pants with the Demonic Pact rune:\n\n\nYour pet's critical strikes apply the Demonic Pact effect to your party members for 45 sec. Demonic Pact increases spell damage and healing by 10% of your spell damage or (Level / 2), whichever is higher. Does not work on Subjugated demons.\n\"Teaches you a new Engraving ability.\""},
[210825] = {name = "Rune of the Warbringer", additional_info = "Binds when picked up\nUnique\nClasses: Warrior\nEngrave your chest with the Warbringer rune:\n\n\nYour Charge, Intercept, and Intervene abilities are now usable while in combat and in any stance, and will all remove movement impairing effects when activated.\n\"Teaches you a new Engraving ability.\""},
[210953] = {name = "Eye of Bhossca", additional_info = "Binds when picked up\nUnique\n\"Though the eye is inanimate, you feel watched...\""},
[210955] = {name = "Scarlet Initiate's Uniform", additional_info = "Binds when picked up\nUnique\nUse: Disguise yourself as a member of the Scarlet Crusade. Suspicious activity will break the disguise."},
[210963] = {name = "Scryer's Key", additional_info = "Binds when picked up\nUnique\nClasses: Rogue"},
[210966] = {name = "Blood of the Legion", additional_info = "Quest Item\nUnique (10)\n\"Dark and thick... This blood links back to great commanders of the legion.\""},
[210967] = {name = "Confidential Message", additional_info = "Binds when picked up\nUnique\nClasses: Rogue\n<Right Click to Read>"},
[210968] = {name = "Reliquary Key", additional_info = "Binds when picked up\nUnique\nClasses: Rogue"},
[210979] = {name = "Rune of Blade Rush", additional_info = "Binds when picked up\nUnique\nClasses: Rogue\n\"Teaches you a new Engraving ability.\""},
[210980] = {name = "Rune of Metamorphosis", additional_info = "Binds when picked up\nUnique\nClasses: Warlock\nEngrave your gloves with the Metamorphosis rune:\n\n\nTransform into a Demon, increasing Armor by 500%, reducing the chance you will be critically hit by 6%, increasing your threat by 50%, increasing mana gained from Life Tap by 100%, transforming the functionality of some of your abilities, and granting some new abilities:\n\n Searing Pain: Now instant.\n\n Shadow Bolt: Becomes Shadow Cleave, a Shadow melee attack that hits up to 3 nearby enemies, but has a 6 sec cooldown.\n\n Fear: Replaced with Menace.\n\n\nTaunts the target to attack you, but has no effect if the target is already attacking you.\n\n Demon Charge\n\n\nCharge an enemy and stun it for 1 sec.  Cannot be used in combat.\n\n Demonic Howl\n\n\nForces all nearby enemies to focus attacks on you for 6 sec.\n\"Teaches you a new Engraving ability.\""},
[211205] = {name = "Rune of Heart of the Lion", additional_info = "Binds when picked up\nUnique\nClasses: Hunter\nEngrave your chest or robe with the Heart of the Lion rune:\n\n\nThe hunter invokes the heart of a lion, increasing total stats by 10% for all nearby allies, and increasing total stats for the Hunter by an additional 10%.\n\"Teaches you a new Engraving ability.\""},
[211247] = {name = "Pattern: Phoenix Bindings", additional_info = "Binds when picked up\nRequires Tailoring (125)\nUse: Teaches you how to sew Phoenix Bindings.\nPhoenix Bindings\nBinds when equipped\nWrist Cloth\n21 Armor\nDurability 30 / 30\nRequires Level 25\nEquip: Increases damage done by Fire spells and effects by up to 13.\nRequires Bolt of Woolen Cloth (6), Flask of Oil (2), Fine Thread (2)"},
