[211385] = {name = "Rune of Serpent Spread", additional_info = "Binds when picked up\nUnique\nClasses: Hunter\nEngrave your pants with the Serpent Spread rune:\n\n\nTargets hit by your Multi-Shot are also afflicted by your Serpent Sting for 6 sec.\n\"Teaches you a new Engraving ability.\""},
[211386] = {name = "Spell Notes: Arcane Surge", additional_info = "Binds when picked up\nUnique\nClasses: Mage\nEngrave your pants with the Arcane Surge rune:\n\n\nUnleash all of your remaining mana in a surge of energy focused at the target dealing (* 226 / 100) to (* 264 / 100) Arcane damage, increased by up to 300% based on your mana remaining. Afterward, your normal mana regeneration is activated and increased by 300% for 8 sec.\n\"Teaches you a new Engraving ability.\""},
[211387] = {name = "Rune of Beckoning Light", additional_info = "Binds when picked up\nUnique\nClasses: Paladin\nEngrave your gloves with the Beacon of Light rune:\n\n\nThe target becomes a Beacon of Light to all members of your party or raid within a 40 yard radius.  Any heals you cast on party or raid members will also heal the Beacon for 100% of the amount healed.  Only one target can be the Beacon of Light at a time. Lasts 1 min.\n\"Teaches you a new Engraving ability.\""},
[211390] = {name = "Rune of Teasing", additional_info = "Binds when picked up\nUnique\nClasses: Rogue\nEngrave your chest or robe with the Just a Flesh Wound rune:\n\n\nYou take 20% reduced Physical damage while Blade Dance is active. Additionally, you have 6% reduced chance to be critically hit by melee attacks, the threat generated by all your actions is massively increased, and your Feint ability is replaced with Tease, which Taunts the target to attack you.\n\n\nTaunts the target to attack you, but has no effect if the target is already attacking you.\n\"Teaches you a new Engraving ability.\""},
[211391] = {name = "Rune of Healing Rain", additional_info = "Binds when picked up\nUnique\nClasses: Shaman\nEngrave your chest or robe with the Healing Rain rune:\n\n\nSelects the area 15 yards around target player, and heals all of target player's party members within that area for (* 15 / 100) every second.\n\"Teaches you a new Engraving ability.\""},
[211392] = {name = "Rune of Everlasting Affliction", additional_info = "Binds when picked up\nClasses: Warlock\nEngrave your pants with the Everlasting Affliction rune:\n\n\nDrain Life, Drain Soul, Shadowbolt, Shadow Cleave, Searing Pain, Incinerate, and Haunt refresh the duration of your Corruption on the target back to its maximum duration.\n\"Teaches you a new Engraving ability.\""},
[211393] = {name = "Rune of Single-Minded Fury", additional_info = "Binds when picked up\nUnique\nClasses: Warrior\nEngrave your gloves with the Single-Minded Fury rune:\n\n\nWhile dual-wielding, your Physical damage and movement speed are increased by 10%.\n\"Teaches you a new Engraving ability.\""},
[211419] = {name = "Handful of Shifting Scales", additional_info = "Binds when picked up\nUnique\n\"These curious scales seem to shimmer slightly, as if they are not fully corporeal. There is clearly wonderous magic at play here... if only you could find someone who knows more about them.\""},
[211420] = {name = "Shifting Scale Talisman", additional_info = "Binds when picked up\nTrinket\n+5 Spirit\nRequires Level 25\nEquip: Protects the bearer from the effects of Crushing Darkness."},
[211421] = {name = "The Box", additional_info = "Binds when picked up\nUnique\nUse: Attempt to use a powerful source of The Light to destroy The Box.\n\"Touching the box with your bare hands immediately fills you with a sense of deep disquiet... but also, a sense of creative inspiration like you've never felt before.\""},
[211422] = {name = "Shard of the Void", additional_info = "Binds when picked up\nUnique\n\"All that remains of the box is a tiny sliver of perfectly black crystal. It seems to draw in and consume the light.\""},
[211423] = {name = "Void-Touched Leather Gloves", additional_info = "Void-Touched Leather Gloves SoD Phase 1\nBinds when picked up\nUnique-Equipped: Void-Touched (1)\nHands Leather\n110 Armor\n+6 Agility\n+6 Stamina\n+4 Spirit\nDurability 70 / 70\nRequires Level 25\nRequires Leatherworking (100)\nEquip: Improves your chance to hit with spells and with melee and ranged attacks by 1%.\nUse: Descend into madness, increasing attack speed by 10% as well as increasing the threat you generate for 10 sec. (10 Min Cooldown)"},
[211443] = {name = "Blade of Rage", additional_info = "Binds when picked up\nTwo-Hand Sword\n31 - 47 Damage Speed 3.50\n(11.14 damage per second)\n50 Armor\n+3 Strength\nDurability 60 / 60\nRequires Level 13"},
