[211472] = {name = "Libram of Banishment", additional_info = "Binds when picked up\nUnique\nRelic Libram\nClasses: Paladin\nRequires Level 24\nEngrave your pants with the Exorcist rune:\n\n\nExorcism can now be cast on any target and has 100% increased critical strike chance against Undead and Demons.\n\"Learn a new ability after casting Turn Undead on 5 enemies, and slaying them with Exorcism.\""},
[211476] = {name = "Rune of Fires Wake", additional_info = "Binds when picked up\nUnique\nClasses: Warlock\nEngrave your chest or robe with the Lake of Fire rune:\n\n\nRain of Fire also leaves a Lake of Fire on the ground that increases all Fire damage you deal and your Demon pet deals to affected enemies by 40% for 15 sec.\n\"Teaches you a new Engraving ability.\""},
[211477] = {name = "Rune of Incinerate", additional_info = "Binds when picked up\nUnique\nClasses: Warlock\nEngrave your pants with the Incinerate rune:\n\n\nBurn your enemy for (222 / 100 *) to (258 / 100 *) damage and increase all Fire damage you deal by 25% for the next 15 sec.\n\"Teaches you a new Engraving ability.\""},
