[211487] = {name = "Demolition Explosives", additional_info = "Binds when picked up\nUnique\nUse: Place a bomb with a short fuse on the ground in front of you.\n\"Only seems useful for clearing out debris and rubble.\""},
[211488] = {name = "Rune of the Avenger", additional_info = "Binds when picked up\nUnique\nClasses: Paladin\nEngrave your pants with the Avenger's Shield rune:\n\n\nHurls a holy shield at the enemy, dealing (366 */ 100 + 0.091 * Spell power + 0.091 * Attack power) to (448 */ 100 + 0.091 * Spell power + 0.091 * Attack power) Holy damage, Dazing them and then jumping to additional nearby enemies.  Affects 3 total targets.  Lasts 10 sec.\n\"Teaches you a new Engraving ability.\""},
[211490] = {name = "Prophecy of a Thousand Lights", additional_info = "Binds when picked up\nUnique\nClasses: Priest\nEngrave your gloves with the Circle of Healing rune:\n\n\nHeals all of target player's party members within 40 yards of target player for (* 130 / 100) to (* 144 / 100).\nUse: Focus on the Prophecy to learn a new spell.  Requires a mind focused by meditating on two spiritual mysteries of Azeroth.\n\"Learn a new Engraving ability.\""},
