[211500] = {name = "Resilient Cloth Headband", additional_info = "Binds when picked up\nUnique\nHead Cloth\n50 Armor\nDurability 50 / 50\nRequires Level 20\nEquip: Reduces all damage taken and chance to be critically hit by 5% in Warsong Gulch."},
