[211504] = {name = "Twilight Avenger's Chain", additional_info = "Binds when picked up\nChest Mail\n218 Armor\n+9 Strength\n+6 Agility\n+8 Stamina\nDurability 120 / 120\nRequires Level 25\nEquip: Increased Defense +4.\n\nBlackfathom Avenger's Mail (0/3)\nTwilight Avenger's Boots\nTwilight Avenger's Chain\nTwilight Avenger's Helm\n(2) Set : +12 Attack Power.\n(3) Set : Improves your chance to hit with spells and with melee and ranged attacks by 1%."},
[211505] = {name = "Twilight Avenger's Helm", additional_info = "Binds when picked up\nHead Mail\n176 Armor\n+9 Strength\n+11 Agility\n+3 Stamina\nDurability 70 / 70\nRequires Level 25\nEquip: Increased Defense +4.\n\nBlackfathom Avenger's Mail (0/3)\nTwilight Avenger's Boots\nTwilight Avenger's Chain\nTwilight Avenger's Helm\n(2) Set : +12 Attack Power.\n(3) Set : Improves your chance to hit with spells and with melee and ranged attacks by 1%."},
[211506] = {name = "Twilight Avenger's Boots", additional_info = "Binds when picked up\nFeet Mail\n150 Armor\n+10 Strength\n+5 Stamina\nDurability 60 / 60\nRequires Level 25\n\nBlackfathom Avenger's Mail (0/3)\nTwilight Avenger's Boots\nTwilight Avenger's Chain\nTwilight Avenger's Helm\n(2) Set : +12 Attack Power.\n(3) Set : Improves your chance to hit with spells and with melee and ranged attacks by 1%."},
[211507] = {name = "Twilight Elementalist's Cowl", additional_info = "Binds when picked up\nHead Leather\n84 Armor\n+9 Stamina\n+10 Intellect\nDurability 60 / 60\nRequires Level 25\nEquip: Increases damage and healing done by magical spells and effects by up to 8.\n\nBlackfathom Elementalist's Hide (0/3)\nTwilight Elementalist's Cowl\nTwilight Elementalist's Footpads\nTwilight Elementalist's Robe\n(2) Set : Increases damage and healing done by magical spells and effects by up to 12.\n(3) Set : Improves your chance to hit with spells and with melee and ranged attacks by 1%."},
[211508] = {name = "Twilight Elementalist's Footpads", additional_info = "Binds when picked up\nFeet Leather\n71 Armor\n+5 Agility\n+7 Intellect\n+7 Spirit\nDurability 55 / 55\nRequires Level 25\n\nBlackfathom Elementalist's Hide (0/3)\nTwilight Elementalist's Cowl\nTwilight Elementalist's Footpads\nTwilight Elementalist's Robe\n(2) Set : Increases damage and healing done by magical spells and effects by up to 12.\n(3) Set : Improves your chance to hit with spells and with melee and ranged attacks by 1%."},
