[211512] = {name = "Twilight Slayer's Tunic", additional_info = "Binds when picked up\nChest Leather\n103 Armor\n+13 Agility\n+9 Stamina\nDurability 100 / 100\nRequires Level 25\n\nBlackfathom Slayer's Leather (0/3)\nTwilight Slayer's Cowl\nTwilight Slayer's Footpads\nTwilight Slayer's Tunic\n(2) Set : +12 Attack Power.\n(3) Set : Improves your chance to hit with spells and with melee and ranged attacks by 1%."},
[211514] = {name = "Spell Notes: Mass Regeneration", additional_info = "Binds when picked up\nUnique\nClasses: Mage\nEngrave your pants with the Mass Regeneration rune:\n\n\nHeals all of target player's party members within 30 yards of target player for (* 42 / 100 * 3) health over 3 sec and applies Temporal Beacon to each target for 15 sec.\n\n Temporal Beacon\n\nRecords the subject's space-time position. 80% of all Arcane damage done by the caster will be converted to chronomantic healing on each of the caster's current Temporal Beacon targets. This healing is reduced by 50% on self, and also reduced by 80% when damage is done by Arcane Explosion.\n\"Teaches you a new Engraving ability.\""},
[211528] = {name = "Dark Insight", additional_info = "Binds when picked up\nUnique\nClasses: Priest\nUse: Consider at a certain secluded grave in Duskwood to receive a prophecy."},
[211530] = {name = "Prophecy of a City Enthralled", additional_info = "Binds when picked up\nUnique\nClasses: Priest\nEngrave your pants with the Power Word: Barrier rune:\n\n\nSummons a holy barrier to protect all party members at the target location for 10 sec, reducing all damage taken by 25% and preventing damage from delaying spellcasting.\nUse: Focus on the Prophecy to learn a new spell.  Requires a mind focused by meditating on two spiritual mysteries of Azeroth."},
[211531] = {name = "Prophecy of Seven Visitors", additional_info = "Binds when picked up\nUnique\nClasses: Priest\nEngrave your chest or robe with the Strength of Soul rune:\n\n\nLesser Heal, Heal, Greater Heal, and Flash Heal reduce the remaining duration of Weakened Soul on targets they heal by 4 sec. In addition, targets of your Power Word: Shield will gain Rage from taking damage despite the damage being absorbed, and Righteous Fury will trigger from damage absorbed by your Power Word: Shield as if it were a heal.\nUse: Focus on the Prophecy to learn a new spell.  Requires a mind focused by meditating on two spiritual mysteries of Azeroth."},
[211534] = {name = "Primal Insight", additional_info = "Binds when picked up\nUnique\nClasses: Priest\nUse: Consider at a Thistlefur dreamcatcher high in the canopy to receive a prophecy."},
[211691] = {name = "Spell Notes: Arcane Blast", additional_info = "Binds when picked up\nUnique\nClasses: Mage\nEngrave your gloves with the Arcane Blast rune:\n\n\nBlasts the target with energy, dealing (* 453 / 100) to (* 527 / 100) Arcane damage.  Each time you cast Arcane Blast, the damage and healing of all other Arcane spells is increased by 15% and mana cost of Arcane Blast is increased by 175%.  Effect stacks up to 4 times and lasts 6 sec or until any other Arcane damage or healing spell is cast.\n\"Teaches you a new Engraving ability.\""},
